import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import * as serviceWorker from './serviceWorker';
import 'tachyons';
import { pokemons } from './Pokemon'

ReactDOM.render(
  <React.StrictMode>
    <Card id = {pokemons[0].id} name={pokemons[0].name} img ={pokemons[0].img}/>
    <Card id = {pokemons[1].id} name={pokemons[1].name} img ={pokemons[1].img}/>
    <Card id = {pokemons[2].id} name={pokemons[2].name} img ={pokemons[2].img}/>
    <Card id = {pokemons[3].id} name={pokemons[3].name} img ={pokemons[3].img}/>
    <Card id = {pokemons[4].id} name={pokemons[4].name} img ={pokemons[4].img}/>
    <Card id = {pokemons[5].id} name={pokemons[5].name} img ={pokemons[5].img}/>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
